import Browse from "./Browse";
import useFetch from "./useFetch";

const Home = () => {
  const { error, isPending, data: movies } = useFetch('http://localhost:8000/blogs')

  return (
    <div className="home">
      { error && <div>{ error }</div> }
      { isPending && <div>Loading...</div> }
      { movies && <BlogList blogs={movies} /> }
    </div>
  );
}

export default Home;
